    false,nt"url": null,nt"notes": "Project proposal for research survey to
    document the breeding ecology of ferruginous hawks, Swainsonu2019s hawk, and northern
    harrier in Kulm Wetland Management District (WMD) in south-central North Dakota.
    This project is needed due to a lack of life history information on these three
    raptors that is necessary to inform management decisions and implement strategic
    habitat conservation at appropriate scales that will benefit these raptor populations.
    This project proposes to assess changes in land cover and landscape composition
    (i.e., habitat) over approximately a 30-year time period (1970s to present) and
    how this measured change has potentially affected the breeding ecology of the ferruginous
    hawk, Swainsonu2019s hawk, and northern harrier. In addition, our proposed project
    (in conjunction with current South Dakota projects) is a combined effort to repeat
    historical studies (Lokemoen and Duebbert 1976, Blair 1978, Blair and Schitoskey
    1982, Gilbert and Stewart 1983), making results obtained from this research especially
    reflective of raptor population changes in portions of North Dakota. Data from this
    study will be combined with data from two concurrent raptor ecology projects beginning
    in spring 2013 in South Dakota and combined results would be provided to NDGF.",nt"owner_org":
